import React from 'react';
import '../App.css'; // Assuming all styles are in App.css

const Header = () => (
  <div className="header">
    {/* Avatar Frame */}
    <div className="avatar-frame">
      {/* Mask Group */}
      <div className="mask-group">
        {/* Union Shape */}
        <img
          src="path/to/union-shape.svg" // Replace with actual path
          alt="Union Shape"
          className="union-shape"
        />
        {/* Mr Journaler Image */}
        <img
          src="chatbot-frontend/src/assets/icons/2.png" // Replace with actual path
          alt="Mr Journaler"
          className="img-mr-journaler"
        />
      </div>
      {/* Ellipse Icon */}
      <img
        src="chatbot-frontend/src/assets/icons/Ellipse 1.svg" // Replace with actual path
        alt="Ellipse Icon"
        className="ellipse-icon"
      />
    </div>

    {/* Community Button */}
    <button className="community-button" onClick={() => window.open('https://t.me/MrJournaler', '_blank')}>
      Go to community
    </button>
  </div>
);

export default Header;
